const App = () => {

  let expanses = [
    {date: '12/072020', Name: 'Njongo', value: '340'},
    {date: '12/072025', Name: 'Kim', value: '750'},
    {date: '12/072027', Name: 'Maryo', value: '850'},

  ]
  return(
    <h1>
    {expanses[0].Name}
    {expanses[0].date}
    {expanses[0].value}
    </h1>
  )
}

export default App
